import React, { useState, useEffect } from 'react';
import { Bell, Upload, MessageCircle, MapPin, LogOut } from 'lucide-react';
import { Card, CardContent, CardHeader, CardTitle } from '@/components/ui/card';
import { Alert, AlertTitle, AlertDescription } from '@/components/ui/alert';

const RTODashboard = () => {
  const [user, setUser] = useState({
    name: "John Doe",
    serviceNumber: "RTO2024001",
    location: null,
    nearRTO: false
  });

  const [documents, setDocuments] = useState([
    { id: 1, name: "Driver's License Renewal", status: "In Progress", priority: "High" },
    { id: 2, name: "Vehicle Registration", status: "Pending", priority: "Medium" },
    { id: 3, name: "Address Change", status: "Completed", priority: "Low" }
  ]);

  // Simulated location check
  useEffect(() => {
    if ("geolocation" in navigator) {
      navigator.geolocation.watchPosition(
        (position) => {
          setUser(prev => ({
            ...prev,
            location: {
              lat: position.coords.latitude,
              lng: position.coords.longitude
            },
            nearRTO: true // This would actually check distance from RTO office
          }));
        },
        (error) => console.error(error),
        { enableHighAccuracy: true }
      );
    }
  }, []);

  return (
    <div className="min-h-screen bg-gray-100">
      {/* Welcome Alert when near RTO */}
      {user.nearRTO && (
        <Alert className="m-4">
          <AlertTitle>Welcome to RTO Office!</AlertTitle>
          <AlertDescription>
            We've detected you're at the RTO office. Your token number is #45.
            Expected waiting time: 20 minutes.
          </AlertDescription>
        </Alert>
      )}

      {/* Header */}
      <header className="bg-white shadow p-4">
        <div className="flex justify-between items-center max-w-7xl mx-auto">
          <div className="flex items-center space-x-4">
            <h1 className="text-2xl font-bold">RTO Services</h1>
            {user.location && (
              <MapPin className="text-green-500" size={20} />
            )}
          </div>
          <div className="flex items-center space-x-4">
            <Bell className="cursor-pointer" />
            <div className="text-right">
              <p className="font-medium">{user.name}</p>
              <p className="text-sm text-gray-500">{user.serviceNumber}</p>
            </div>
            <LogOut className="cursor-pointer text-gray-500" />
          </div>
        </div>
      </header>

      {/* Main Content */}
      <main className="max-w-7xl mx-auto p-4">
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
          {/* Document Status Card */}
          <Card>
            <CardHeader>
              <CardTitle>Document Status</CardTitle>
            </CardHeader>
            <CardContent>
              <div className="space-y-4">
                {documents.map(doc => (
                  <div key={doc.id} className="flex items-center justify-between p-2 bg-gray-50 rounded">
                    <div>
                      <p className="font-medium">{doc.name}</p>
                      <p className="text-sm text-gray-500">Priority: {doc.priority}</p>
                    </div>
                    <span className={`px-2 py-1 rounded text-sm ${
                      doc.status === 'Completed' ? 'bg-green-100 text-green-800' :
                      doc.status === 'In Progress' ? 'bg-blue-100 text-blue-800' :
                      'bg-yellow-100 text-yellow-800'
                    }`}>
                      {doc.status}
                    </span>
                  </div>
                ))}
              </div>
            </CardContent>
          </Card>

          {/* Upload Documents Card */}
          <Card>
            <CardHeader>
              <CardTitle>Upload Documents</CardTitle>
            </CardHeader>
            <CardContent>
              <div className="border-2 border-dashed border-gray-300 rounded-lg p-6 text-center">
                <Upload className="mx-auto text-gray-400" size={24} />
                <p className="mt-2 text-sm text-gray-500">
                  Drag and drop your documents here, or click to select files
                </p>
              </div>
            </CardContent>
          </Card>

          {/* Chat Support Card */}
          <Card>
            <CardHeader>
              <CardTitle>Chat Support</CardTitle>
            </CardHeader>
            <CardContent>
              <div className="h-48 bg-gray-50 rounded-lg p-4 overflow-y-auto mb-4">
                <div className="space-y-2">
                  <p className="bg-blue-100 p-2 rounded-lg inline-block">
                    Hello! How can I help you today?
                  </p>
                </div>
              </div>
              <div className="flex items-center space-x-2">
                <input
                  type="text"
                  placeholder="Type your message..."
                  className="flex-1 p-2 border rounded-lg"
                />
                <MessageCircle className="cursor-pointer text-blue-500" />
              </div>
            </CardContent>
          </Card>
        </div>
      </main>
    </div>
  );
};

export default RTODashboard;
